import React from 'react';
import "antd/dist/antd.css";
import I18n from 'i18n-js';
import "../../bundles/i18n/en.js";
import "../../bundles/i18n/ja.js";
import { Layout, Menu } from 'antd';
import Router from "../routes/_index";
import { BrowserRouter} from "react-router-dom";
import {
  TeamOutlined,
  UserOutlined,
} from '@ant-design/icons';
import logo from "../../../../app/assets/images/logo.svg";
const { Header, Content, Footer, Sider } = Layout;
const { SubMenu } = Menu;

class SideBar extends React.Component {
  state = {
    collapsed: false,
  };

  onCollapse = collapsed => {
    console.log(collapsed);
    this.setState({ collapsed });
  };

  render() {
    const { collapsed } = this.state;
    return (
        <BrowserRouter>
        <Sider collapsible collapsed={collapsed} onCollapse={this.onCollapse}>
            <div><img src={logo} className="logo" alt="logo" style={{
            height: '64px',
            marginLeft: '1rem',
            }}/></div>
            <Menu theme="light" defaultSelectedKeys={['1']} mode="inline">
                <SubMenu key="sub1" icon={<UserOutlined />} title={I18n.t('home.menu1.title')}>
                    <Menu.Item key="1"><Link to="/Users"> {I18n.t('home.menu1.side1')}</Link></Menu.Item>
                    <Menu.Item key="2"><Link to="/GroupSettings"> {I18n.t('home.menu1.side2')}</Link></Menu.Item>
                    <Menu.Item key="3">{I18n.t('home.menu1.side3')}</Menu.Item>
                    <Menu.Item key="4">{I18n.t('home.menu1.side4')}</Menu.Item>
                    <Menu.Item key="5">{I18n.t('home.menu1.side5')}</Menu.Item>
                    <Menu.Item key="6">{I18n.t('home.menu1.side6')}</Menu.Item>
                </SubMenu>
                <Menu.Item key="7" icon={<UserOutlined />}>{I18n.t('home.menu2.title')}</Menu.Item>
                <Menu.Item key="8" icon={<UserOutlined />}>{I18n.t('home.menu3.title')}</Menu.Item>
            </Menu>
        </Sider>
        <Router/>
        </BrowserRouter>
    );
  }
}

export default SideBar;
